import React, { useState } from 'react'
import Navbar from '../components/Navbar/Navbar'
import Footer from '../components/Footer/Footer'
import Sidebar from '../components/Sidebar/Sidebar'
import PageWrapper from '../styled_components/page_wrapper'
import MidScreenWrapper from '../styled_components/mid_screen_wrapper'

const NewGuias = () => {

    const [error, setError] = useState(true);

    const getUserInfo = async (e) => {
        e.preventDefault();

        const config = {
          header: {
            "Content-Type": "multipart/form-data",
          },
        };

        let formData = new FormData();
        formData.append('email', email);   //append the values with key, value pair
        formData.append('password', password);

        try {
          const { data } = await axios.post(
            `${process.env.REACT_APP_API_URL}/user/login`,
            formData,
            config
          );

          localStorage.setItem("access_token", data.data.access_token);
          console.log(data.data.access_token)
          localStorage.setItem("api_key", data.data.user.api_key);
          localStorage.setItem("email", data.data.user.email);
          localStorage.setItem("username", data.data.user.username);
          console.log(data.data.user.api_key)

          history.push("/userdashboard");
        } catch (error) {
          console.log(error)

        }
      };


    return (
    <PageWrapper>
        <Navbar/>
        <MidScreenWrapper>
            <Sidebar setError={setError}/>
            <div>
                <h1>this is new guias</h1>
            </div>
        </MidScreenWrapper>
        <Footer/>
    </PageWrapper>
  )
}

export default NewGuias;
